import { Link } from 'react-router-dom';

function Navigation(){
    return(
        <nav>
            <Link to='/pages/LoginPage'>LoginPage</Link>
            <Link to='/'></Link>
            <Link to='/'></Link>
        </nav>
    )
}

export default Navigation;
